import React from 'react';
import { cars } from './car_stock';  // Імпортуємо дані про авто
import CarCard from './carcrad';     // Імпортуємо компонент для відображення авто

const Catalog = () => {
  return (
    <div className="catalog-page">
      <h1>Каталог Автомобілів</h1>
      <div className="catalog-grid">
        {cars.map((car, index) => (
          <CarCard key={index} car={car} />
        ))}
      </div>
    </div>
  );
};

export default Catalog;
